import React from "react";
import {
  Navbar,
  NavbarBrand,
} from "reactstrap";

class Header extends React.Component {
  render() {
    return (
      <div>
        <Navbar color="purple" >
          <NavbarBrand href="/" className="mr-auto">
            reactstrap
          </NavbarBrand>
        </Navbar>
      </div>
    );
  }
}

export default Header;
